import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import ShoppingList from './ShoppingList'

export class AllShoppingLists extends React.Component {
    render() {
        return(
            <section className="page">
                <div className="wrapper">
                    <h1>Shopping Lists</h1>
                    {data.map(listName => (
                        <ShoppingList
                            key={listName.name}
                            name={listName.name}
                            products={listName.items}
                            size={listName.size}
                        />
                    ))}
                </div>

                <div id="listcontainer">
                <h1>Shopping Lists</h1>
            <h3>breakfast</h3><h3>breakfast</h3><h3>breakfast</h3>
                </div>
            </section>

        );
    }

}
export default AllShoppingLists;
